DROP DATABASE IF EXISTS TIEMTS;
CREATE DATABASE TIEMTS;
USE TIEMTS;
SET NAMES UTF8;

DROP TABLE IF EXISTS LICHSU, LUONGMUA, KHACHHANG, NHANVIEN, TRASUA;

CREATE TABLE TRASUA
(
	MASP VARCHAR(50) PRIMARY KEY NOT NULL, -- PK
    TENSP NVARCHAR(100) NOT NULL,
    GIA MEDIUMINT UNSIGNED
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE NHANVIEN
(
	MANV CHAR(10) NOT NULL PRIMARY KEY,  -- PK
    TENNV NVARCHAR(100) NOT NULL,
    SDT VARCHAR(11) UNIQUE NOT NULL
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE KHACHHANG
(
	MAKH INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    TENKH NVARCHAR(100) NOT NULL,
    DIACHI NVARCHAR(255) NOT NULL,
    SODT VARCHAR(11)
) CHARSET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE LUONGMUA
(
	SOHD INT UNSIGNED PRIMARY KEY, -- PK
    MASP VARCHAR(50) NOT NULL, -- FK
    SOLUONG SMALLINT
)CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE LICHSU
(
	SOHD INT UNSIGNED, -- PK
    NGAY DATE,
    MAKH INT UNSIGNED,
    MANV CHAR(10) NOT NULL -- FK
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

ALTER TABLE LUONGMUA ADD CONSTRAINT FOREIGN KEY (MASP) REFERENCES TRASUA(MASP) ON UPDATE CASCADE ON DELETE CASCADE;
ALTER TABLE LICHSU ADD CONSTRAINT FOREIGN KEY (MANV) REFERENCES NHANVIEN(MANV) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE LUONGMUA ADD CONSTRAINT chk_lm CHECK( SOLUONG>=1 );





